const https = require('https');

// A simple 1x1 red pixel base64
const validBase64 = "data:image/png;base64,";

const data = JSON.stringify({
  captcha: validBase64
});

console.log('Sending request with captcha image...');

const options = {
  hostname: 'cloudify-theta.vercel.app',
  port: 443,
  path: '/solve', // <--- change this based on your route, if root then "/"
  method: 'POST',
  headers: {
    'Content-Type': 'application/json',
    'Content-Length': Buffer.byteLength(data)
  }
};

const req = https.request(options, (res) => {
  console.log(`StatusCode: ${res.statusCode}`);
  
  let body = '';
  res.on('data', chunk => {
    body += chunk;
  });
  
  res.on('end', () => {
    console.log('Response:', body);
  });
});

req.on('error', (error) => {
  console.error('Error:', error.message);
});

req.write(data);
req.end();